INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", "2030/12/17 14:59:59", 401, 2, 0.0, 24, 102301, 2, "2020/07/31 12:00:00", 10046, "アヤネ", 0.0, 0.0, 24001);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", "2030/12/17 14:59:59", 402, 2, 2.21, 24, 102301, 1, "2020/07/31 12:00:00", 10046, "アヤネ", 0.0, 0.0, 24002);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", "2030/12/17 14:59:59", 403, 2, 0.0, 24, 102301, 2, "2020/07/31 12:00:00", 10046, "アヤネ", 0.0, 0.0, 24003);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", "2030/12/17 14:59:59", 701, 1, 1.99, 24, 192201, 2, "2020/07/31 12:00:00", 10046, "アサヒ", 0.0, 0.0, 24004);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", "2030/12/17 14:59:59", 702, 2, 2.21, 24, 192201, 1, "2020/07/31 12:00:00", 10046, "アサヒ", 0.0, 0.0, 24005);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", "2030/12/17 14:59:59", 703, 1, 3.33, 24, 192201, 2, "2020/07/31 12:00:00", 10046, "アサヒ", 0.0, 0.0, 24006);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", "2030/12/17 14:59:59", 801, 2, 0.0, 24, 192301, 2, "2020/07/31 12:00:00", 10046, "部員３", 0.0, 0.0, 24007);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", "2030/12/17 14:59:59", 802, 2, 2.68, 24, 192301, 1, "2020/07/31 12:00:00", 10046, "部員３", 0.0, 0.0, 24008);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", "2030/12/17 14:59:59", 803, 2, 0.0, 24, 192301, 2, "2020/07/31 12:00:00", 10046, "部員３", 0.0, 0.0, 24009);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("やった！", "2030/12/17 14:59:59", 501, 1, 0.0, 24, 192501, 1, "2020/07/31 12:00:00", 10046, "", 0.0, 0.0, 24010);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("勝ったよ！", "2030/12/17 14:59:59", 502, 1, 0.0, 24, 192501, 1, "2020/07/31 12:00:00", 10046, "", 0.0, 0.0, 24011);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("いい調子！", "2030/12/17 14:59:59", 503, 1, 0.0, 24, 192501, 1, "2020/07/31 12:00:00", 10046, "", 0.0, 0.0, 24012);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", "2030/12/17 14:59:59", 111, 2, 5.33, 24, 113501, 6, "2020/07/31 12:00:00", 10046, "ミサト", 0.0, 0.0, 24013);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", "2030/12/17 14:59:59", 112, 2, 6.85, 24, 113501, 1, "2020/07/31 12:00:00", 10046, "ミサト", 0.0, 0.0, 24014);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", "2030/12/17 14:59:59", 113, 2, 3.0, 24, 113501, 1, "2020/07/31 12:00:00", 10046, "ミサト", 0.0, 0.0, 24015);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", "2030/12/17 14:59:59", 611, 2, 6.11, 24, 192401, 1, "2020/07/31 12:00:00", 10046, "ダイチ", 0.0, 0.0, 24016);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", "2030/12/17 14:59:59", 612, 2, 6.75, 24, 192401, 1, "2020/07/31 12:00:00", 10046, "ダイチ", 0.0, 0.0, 24017);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", "2030/12/17 14:59:59", 613, 2, 0.0, 24, 192401, 2, "2020/07/31 12:00:00", 10046, "ダイチ", 0.0, 0.0, 24018);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", "2030/12/17 14:59:59", 211, 1, 4.52, 24, 113401, 2, "2020/07/31 12:00:00", 10046, "ハツネ", 0.0, 0.0, 24019);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", "2030/12/17 14:59:59", 212, 1, 3.89, 24, 113401, 2, "2020/07/31 12:00:00", 10046, "ハツネ", 0.0, 0.0, 24020);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", "2030/12/17 14:59:59", 213, 2, 13.49, 24, 113401, 1, "2020/07/31 12:00:00", 10046, "ハツネ", 0.0, 0.0, 24021);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", "2030/12/17 14:59:59", 311, 2, 3.17, 24, 106501, 1, "2020/07/31 12:00:00", 10046, "カヤ", 0.0, 0.0, 24022);
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES ("どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", "2030/12/17 14:59:59", 312, 2, 4.42, 24, 106501, 1, "2020/07/31 12:00:00", 10046, "カヤ", 0.0, 0.0, 24023);
